import React, { useState } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import { Bars3Icon, XMarkIcon, UserIcon } from '@heroicons/react/24/outline';
import routes from '../route';
import { logout, isAuthenticated } from '../utils/auth';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav className="sticky top-0 z-50 bg-white/90 backdrop-blur supports-[backdrop-filter]:bg-white/90 border-b border-gray-100">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between py-3">
          <Link to="/" className="text-2xl font-bold text-primary-700 flex items-center">
            <UserIcon className="h-8 w-8 mr-2 text-primary-500" />
            MediCare
          </Link>

          <div className="hidden md:flex items-center space-x-8">
            {routes
              .filter(r => (r.protected ? isAuthenticated() : true))
              .map((route) => (
                <Link
                  key={route.path}
                  to={route.path}
                  className={`relative transition-colors font-medium group ${location.pathname === route.path ? 'text-primary-700' : 'text-gray-700 hover:text-primary-700'}`}
                >
                  <span>{route.name}</span>
                  <span className={`absolute left-0 -bottom-1 h-0.5 ${location.pathname === route.path ? 'w-full' : 'w-0 group-hover:w-full'} bg-primary-600 transition-all duration-200`} />
                </Link>
              ))}
          </div>

          <div className="hidden md:flex items-center space-x-4">
            {isAuthenticated() ? (
              <button
                onClick={handleLogout}
                className="bg-primary-500 text-white px-4 py-2 rounded-lg hover:bg-primary-600 transition-colors"
              >
                Logout
              </button>
            ) : (
              <Link
                to="/login"
                className="bg-primary-500 text-white px-4 py-2 rounded-lg hover:bg-primary-600 transition-colors"
              >
                Login
              </Link>
            )}
          </div>

          <div className="md:hidden">
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="text-gray-700 hover:text-primary-600"
            >
              {isOpen ? <XMarkIcon className="h-6 w-6" /> : <Bars3Icon className="h-6 w-6" />}
            </button>
          </div>
        </div>

        {isOpen && (
          <div className="md:hidden pb-3 mb-3 space-y-2 rounded-2xl border border-gray-100 bg-white/95 backdrop-blur supports-[backdrop-filter]:bg-white/95 shadow-md">
            {routes
              .filter(r => (r.protected ? isAuthenticated() : true))
              .map((route) => (
                <Link
                  key={route.path}
                  to={route.path}
                  className="block px-4 py-2 text-gray-700 hover:text-primary-600 hover:bg-primary-50 rounded"
                  onClick={() => setIsOpen(false)}
                >
                  {route.name}
                </Link>
              ))}
            {isAuthenticated() ? (
              <button
                onClick={handleLogout}
                className="block w-full text-left px-4 py-2 text-red-600 hover:bg-red-50 rounded"
              >
                Logout
              </button>
            ) : (
              <Link
                to="/login"
                className="block px-4 py-2 text-primary-600 hover:bg-primary-50 rounded"
                onClick={() => setIsOpen(false)}
              >
                Login
              </Link>
            )}
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
